export const CONFIG_TOKEN = new InjectionToken<AngTogglerConfigI>('AngTogglerModuleConfig');

@NgModule({
  declarations: [
    AngTogglerComponent
  ],
  imports: [
    CommonModule
  ],
  exports: [
