export class AngTogglerModule {
  static forRoot(config: AngTogglerConfigI = {}): ModuleWithProviders<AngTogglerModule> {
    return {
      ngModule: AngTogglerModule,
      providers: [{
        provide: CONFIG_TOKEN,
        useValue: config
      }]
    };
  }
}

